    // localStorage.setItem('currentUser', JSON.stringify(user1));\n    // this.currentUserSubject.next(user1);\n    // return user1;\n\n\n  }\n\n  logout() {\n    // remove user from local storage and set current user to null\n  //  localStorage.removeItem('currentUser');\n  //  this.currentUserSubject.next(null);\n     this.cookieService.delete('cuki');\n\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/Author.html":{"url":"interfaces/Author.html","title":"interface - Author","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  Author\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/models/author.ts\n        \n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        first_name\n                                \n                                \n                                        id\n                                \n                                \n                                        last_name\n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        first_name\n                                    \n                                \n      